The WasmEdge QuickJS runtime supports ES6 modules. This article will show you how to use ES6 module in WasmEdge. We will take the example in example_js/es6_module_demo folder as an example. The module_def.js file defines and exports a simple JS function. function hello(){ console.log('hello from module_def.js')
} export {hello} The module_def_async.js file defines and exports an aysnc function and a variable. export async function hello(){ console.log('hello from module_def_async.js') return "module_def_async.js : return value"
} export var something = "async thing" The demo.js file imports functions and variables from those modules and executes them. import { hello as module_def_hello } from './module_def.js'
module_def_hello() var f = async ()=>{ let {hello , something} = await import('./module_def_async.js') await hello() console.log("./module_def_async.js `something` is ",something)
}
f() To run the example, you can do the following on the CLI. $ cd example_js/es6_module_demo
$ wasmedge --dir .:. ../../target/wasm32-wasi/release/wasmedge_quickjs.wasm demo.js
hello from module_def.js
hello from module_def_async.js
./module_def_async.js `something` is async thing Note, the --dir .:. on the command line is to give wasmedge permission to read the local directory in the file system for the demo.js file.

