The following code snippet defines a Rust function that can be incorporate into the JavaScript interpreter as an API. fn run_rust_function(ctx: &mut Context) { struct HelloFn; impl JsFn for HelloFn { fn call(_ctx: &mut Context, _this_val: JsValue, argv: &[JsValue]) -> JsValue { println!("hello from rust"); println!("argv={:?}", argv); JsValue::UnDefined } } ...
} The following code snippet shows how to add this Rust function into the JavaScript interpreter, give a name hi() as its JavaScript API, and then call it from JavaScript code. fn run_rust_function(ctx: &mut Context) { ... let f = ctx.new_function::<HelloFn>("hello"); ctx.get_global().set("hi", f.into()); let code = r#"hi(1,2,3)"#; let r = ctx.eval_global_str(code); println!("return value:{:?}", r);
} The execution result is as follows. hello from rust
argv=[Int(1), Int(2), Int(3)]
return value:UnDefined Using this approach, you can create a JavaScript interpreter with customized API functions. The interpreter runs inside WasmEdge, and can execute JavaScript code, which calls such API functions, from CLI or the network.

