In the JavaScript API design, we sometimes need to provide an object that encapsulates both data and function. In the following example, we define a Rust function for the JavaScript API. fn rust_new_object_and_js_call(ctx: &mut Context) { struct ObjectFn; impl JsFn for ObjectFn { fn call(_ctx: &mut Context, this_val: JsValue, argv: &[JsValue]) -> JsValue { println!("hello from rust"); println!("argv={:?}", argv); if let JsValue::Object(obj) = this_val { let obj_map = obj.to_map(); println!("this={:#?}", obj_map); } JsValue::UnDefined } } We then create an "object" on the Rust side, set its data fields, and then register the Rust function as a JavaScript function associated with the objects. let mut obj = ctx.new_object(); obj.set("a", 1.into()); obj.set("b", ctx.new_string("abc").into()); let f = ctx.new_function::<ObjectFn>("anything"); obj.set("f", f.into()); Next, we make the Rust "object" available as JavaScript object test_obj in the JavaScript interpreter. ctx.get_global().set("test_obj", obj.into()); In the JavaScript code, you can now directly use test_obj as part of the API. let code = r#" print('test_obj keys=',Object.keys(test_obj)) print('test_obj.a=',test_obj.a) print('test_obj.b=',test_obj.b) test_obj.f(1,2,3,"hi") "#; ctx.eval_global_str(code);
} The execution result is as follows. test_obj keys= a,b,f
test_obj.a= 1
test_obj.b= abc
hello from rust
argv=[Int(1), Int(2), Int(3), String(JsString(hi))]
this=Ok( { "a": Int( 1, ), "b": String( JsString( abc, ), ), "f": Function( JsFunction( function anything() { [native code] }, ), ), },
)

