The following is an example for running a WASM file. Assume that the WASM file fibonacci.wasm is copied into the current directory, and the C file test_wasmedge.c is as following: #include <wasmedge/wasmedge.h>
#include <stdio.h>
int main(int Argc, const char* Argv[]) { /* Create the configure context and add the WASI support. */ /* This step is not necessary unless you need WASI support. */ WasmEdge_ConfigureContext *ConfCxt = WasmEdge_ConfigureCreate(); WasmEdge_ConfigureAddHostRegistration(ConfCxt, WasmEdge_HostRegistration_Wasi); /* The configure and store context to the VM creation can be NULL. */ WasmEdge_VMContext *VMCxt = WasmEdge_VMCreate(ConfCxt, NULL); /* The parameters and returns arrays. */ WasmEdge_Value Params[1] = { WasmEdge_ValueGenI32(32) }; WasmEdge_Value Returns[1]; /* Function name. */ WasmEdge_String FuncName = WasmEdge_StringCreateByCString("fib"); /* Run the WASM function from file. */ WasmEdge_Result Res = WasmEdge_VMRunWasmFromFile(VMCxt, Argv[1], FuncName, Params, 1, Returns, 1); if (WasmEdge_ResultOK(Res)) { printf("Get result: %d\n", WasmEdge_ValueGetI32(Returns[0])); } else { printf("Error message: %s\n", WasmEdge_ResultGetMessage(Res)); } /* Resources deallocations. */ WasmEdge_VMDelete(VMCxt); WasmEdge_ConfigureDelete(ConfCxt); WasmEdge_StringDelete(FuncName); return 0;
} Then you can compile and run: (the 32th fibonacci number is 3524578 in 0-based index) $ gcc test_wasmedge.c -lwasmedge_c -o test_wasmedge
$ ./test_wasmedge fibonacci.wasm
Get result: 3524578 For the details of APIs, please refer to the API header file .

