The WasmEdge_String object is for the instance names when invoking a WASM function or finding the contexts of instances. Create a WasmEdge_String from a C string (const char * with NULL termination) or a buffer with length. The content of the C string or buffer will be copied into the WasmEdge_String object. char Buf[4] = {50, 55, 60, 65};
WasmEdge_String Str1 = WasmEdge_StringCreateByCString("test");
WasmEdge_String Str2 = WasmEdge_StringCreateByBuffer(Buf, 4);
/* The objects should be deleted by `WasmEdge_StringDelete()`. */
WasmEdge_StringDelete(Str1);
WasmEdge_StringDelete(Str2); Wrap a WasmEdge_String to a buffer with length. The content will not be copied, and the caller should guarantee the life cycle of the input buffer. const char CStr[] = "test";
WasmEdge_String Str = WasmEdge_StringWrap(CStr, 4);
/* The object should __NOT__ be deleted by `WasmEdge_StringDelete()`. */ String comparison const char CStr[] = "abcd";
char Buf[4] = {0x61, 0x62, 0x63, 0x64};
WasmEdge_String Str1 = WasmEdge_StringWrap(CStr, 4);
WasmEdge_String Str2 = WasmEdge_StringCreateByBuffer(Buf, 4);
bool IsEq = WasmEdge_StringIsEqual(Str1, Str2);
/* The `IsEq` will be `TRUE`. */
WasmEdge_StringDelete(Str2); Convert to C string char Buf[256];
WasmEdge_String Str = WasmEdge_StringCreateByCString("test_wasmedge_string");
uint32_t StrLength = WasmEdge_StringCopy(Str, Buf, sizeof(Buf));
/* StrLength will be 20 */
printf("String: %s\n", Buf);
/* Will print "test_wasmedge_string". */

