The WASM data structures are used for creating instances or can be queried from instance contexts. The details of instances creation will be introduced in the Instances . Limit The WasmEdge_Limit struct is defined in the header: /// Struct of WASM limit.
typedef struct WasmEdge_Limit { /// Boolean to describe has max value or not. bool HasMax; /// Minimum value. uint32_t Min; /// Maximum value. Will be ignored if the `HasMax` is false. uint32_t Max;
} WasmEdge_Limit; Developers can initialize the struct by assigning it's value, and the Max value is needed to be larger or equal to the Min value. The API WasmEdge_LimitIsEqual() is provided to compare with 2 WasmEdge_Limit structs. Function type context The Function Type context is used for the Function creation, checking the value types of a Function instance, or getting the function type with function name from VM. Developers can use the Function Type context APIs to get the parameter or return value types information. enum WasmEdge_ValType ParamList[2] = { WasmEdge_ValType_I32, WasmEdge_ValType_I64 };
enum WasmEdge_ValType ReturnList[1] = { WasmEdge_ValType_FuncRef };
WasmEdge_FunctionTypeContext *FuncTypeCxt = WasmEdge_FunctionTypeCreate(ParamList, 2, ReturnList, 1); enum WasmEdge_ValType Buf[16];
uint32_t ParamLen = WasmEdge_FunctionTypeGetParametersLength(FuncTypeCxt);
/* `ParamLen` will be 2. */
uint32_t GotParamLen = WasmEdge_FunctionTypeGetParameters(FuncTypeCxt, Buf, 16);
/* `GotParamLen` will be 2, and `Buf[0]` and `Buf[1]` will be the same as `ParamList`. */
uint32_t ReturnLen = WasmEdge_FunctionTypeGetReturnsLength(FuncTypeCxt);
/* `ReturnLen` will be 1. */
uint32_t GotReturnLen = WasmEdge_FunctionTypeGetReturns(FuncTypeCxt, Buf, 16);
/* `GotReturnLen` will be 1, and `Buf[0]` will be the same as `ReturnList`. */ WasmEdge_FunctionTypeDelete(FuncTypeCxt); Table type context The Table Type context is used for Table instance creation or getting information from Table instances. WasmEdge_Limit TabLim = {.HasMax = true, .Min = 10, .Max = 20};
WasmEdge_TableTypeContext *TabTypeCxt = WasmEdge_TableTypeCreate(WasmEdge_RefType_ExternRef, TabLim); enum WasmEdge_RefType GotRefType = WasmEdge_TableTypeGetRefType(TabTypeCxt);
/* `GotRefType` will be WasmEdge_RefType_ExternRef. */
WasmEdge_Limit GotTabLim = WasmEdge_TableTypeGetLimit(TabTypeCxt);
/* `GotTabLim` will be the same value as `TabLim`. */ WasmEdge_TableTypeDelete(TabTypeCxt); Memory type context The Memory Type context is used for Memory instance creation or getting information from Memory instances. WasmEdge_Limit MemLim = {.HasMax = true, .Min = 10, .Max = 20};
WasmEdge_MemoryTypeContext *MemTypeCxt = WasmEdge_MemoryTypeCreate(MemLim); WasmEdge_Limit GotMemLim = WasmEdge_MemoryTypeGetLimit(MemTypeCxt);
/* `GotMemLim` will be the same value as `MemLim`. */ WasmEdge_MemoryTypeDelete(MemTypeCxt) Global type context The Global Type context is used for Global instance creation or getting information from Global instances. WasmEdge_GlobalTypeContext *GlobTypeCxt = WasmEdge_GlobalTypeCreate(WasmEdge_ValType_F64, WasmEdge_Mutability_Var); WasmEdge_ValType GotValType = WasmEdge_GlobalTypeGetValType(GlobTypeCxt);
/* `GotValType` will be WasmEdge_ValType_F64. */
WasmEdge_Mutability GotValMut = WasmEdge_GlobalTypeGetMutability(GlobTypeCxt);
/* `GotValMut` will be WasmEdge_Mutability_Var. */ WasmEdge_GlobalTypeDelete(GlobTypeCxt); Import type context The Import Type context is used for getting the imports information from a AST Module . Developers can get the external type (function, table, memory, or global), import module name, and external name from an Import Type context. The details about querying Import Type contexts will be introduced in the AST Module . WasmEdge_ASTModuleContext *ASTCxt = ...;
/* Assume that `ASTCxt` is returned by the `WasmEdge_LoaderContext` for the result of loading a WASM file. */
const WasmEdge_ImportTypeContext *ImpType = ...;
/* Assume that `ImpType` is queried from the `ASTCxt` for the import. */ enum WasmEdge_ExternalType ExtType = WasmEdge_ImportTypeGetExternalType(ImpType);
/* * The `ExtType` can be one of `WasmEdge_ExternalType_Function`, `WasmEdge_ExternalType_Table`, * `WasmEdge_ExternalType_Memory`, or `WasmEdge_ExternalType_Global`. */
WasmEdge_String ModName = WasmEdge_ImportTypeGetModuleName(ImpType);
WasmEdge_String ExtName = WasmEdge_ImportTypeGetExternalName(ImpType);
/* The `ModName` and `ExtName` should not be destroyed and the string buffers are binded into the `ASTCxt`. */
