The configuration context, WasmEdge_ConfigureContext, manages the configurations for Loader, Validator, Executor, VM, and Compiler. Developers can adjust the settings about the proposals, VM host pre-registrations (such as WASI), and AOT compiler options, and then apply the Configure context to create other runtime contexts. Proposals WasmEdge supports turning on or off the WebAssembly proposals. This configuration is effective in any contexts created with the Configure context. enum WasmEdge_Proposal { WasmEdge_Proposal_ImportExportMutGlobals = 0, WasmEdge_Proposal_NonTrapFloatToIntConversions, WasmEdge_Proposal_SignExtensionOperators, WasmEdge_Proposal_MultiValue, WasmEdge_Proposal_BulkMemoryOperations, WasmEdge_Proposal_ReferenceTypes, WasmEdge_Proposal_SIMD, WasmEdge_Proposal_TailCall, WasmEdge_Proposal_Annotations, WasmEdge_Proposal_Memory64, WasmEdge_Proposal_Threads, WasmEdge_Proposal_ExceptionHandling, WasmEdge_Proposal_FunctionReferences
}; Developers can add or remove the proposals into the Configure context. /* * By default, the following proposals have turned on initially: * * Import/Export of mutable globals * * Non-trapping float-to-int conversions * * Sign-extension operators * * Multi-value returns * * Bulk memory operations * * Reference types * * Fixed-width SIMD */
WasmEdge_ConfigureContext *ConfCxt = WasmEdge_ConfigureCreate();
WasmEdge_ConfigureAddProposal(ConfCxt, WasmEdge_Proposal_SIMD);
WasmEdge_ConfigureRemoveProposal(ConfCxt, WasmEdge_Proposal_ReferenceTypes);
bool IsBulkMem = WasmEdge_ConfigureHasProposal(ConfCxt, WasmEdge_Proposal_BulkMemoryOperations);
/* The `IsBulkMem` will be `TRUE`. */
WasmEdge_ConfigureDelete(ConfCxt); Host registrations This configuration is used for the VM context to turn on the WASI or wasmedge_process supports and only effective in VM contexts. enum WasmEdge_HostRegistration { WasmEdge_HostRegistration_Wasi = 0, WasmEdge_HostRegistration_WasmEdge_Process
}; The details will be introduced in the preregistrations of VM context . WasmEdge_ConfigureContext *ConfCxt = WasmEdge_ConfigureCreate();
bool IsHostWasi = WasmEdge_ConfigureHasHostRegistration(ConfCxt, WasmEdge_HostRegistration_Wasi);
/* The `IsHostWasi` will be `FALSE`. */
WasmEdge_ConfigureAddHostRegistration(ConfCxt, WasmEdge_HostRegistration_Wasi);
IsHostWasi = WasmEdge_ConfigureHasHostRegistration(ConfCxt, WasmEdge_HostRegistration_Wasi);
/* The `IsHostWasi` will be `TRUE`. */
WasmEdge_ConfigureDelete(ConfCxt); Maximum memory pages Developers can limit the page size of memory instances by this configuration. When growing the page size of memory instances in WASM execution and exceeding the limited size, the page growing will fail. This configuration is only effective in the Executor and VM contexts. WasmEdge_ConfigureContext *ConfCxt = WasmEdge_ConfigureCreate();
uint32_t PageSize = WasmEdge_ConfigureGetMaxMemoryPage(ConfCxt);
/* By default, the maximum memory page size is 65536. */
WasmEdge_ConfigureSetMaxMemoryPage(ConfCxt, 1024);
/* Limit the memory size of each memory instance with not larger than 1024 pages (64 MiB). */
PageSize = WasmEdge_ConfigureGetMaxMemoryPage(ConfCxt);
/* The `PageSize` will be 1024. */
WasmEdge_ConfigureDelete(ConfCxt); AOT compiler options The AOT compiler options configure the behavior about optimization level, output format, dump IR, and generic binary. enum WasmEdge_CompilerOptimizationLevel { /// Disable as many optimizations as possible. WasmEdge_CompilerOptimizationLevel_O0 = 0, /// Optimize quickly without destroying debuggability. WasmEdge_CompilerOptimizationLevel_O1, /// Optimize for fast execution as much as possible without triggering /// significant incremental compile time or code size growth. WasmEdge_CompilerOptimizationLevel_O2, /// Optimize for fast execution as much as possible. WasmEdge_CompilerOptimizationLevel_O3, /// Optimize for small code size as much as possible without triggering /// significant incremental compile time or execution time slowdowns. WasmEdge_CompilerOptimizationLevel_Os, /// Optimize for small code size as much as possible. WasmEdge_CompilerOptimizationLevel_Oz
}; enum WasmEdge_CompilerOutputFormat { /// Native dynamic library format. WasmEdge_CompilerOutputFormat_Native = 0, /// WebAssembly with AOT compiled codes in custom section. WasmEdge_CompilerOutputFormat_Wasm
}; These configurations are only effective in Compiler contexts. WasmEdge_ConfigureContext *ConfCxt = WasmEdge_ConfigureCreate();
/* By default, the optimization level is O3. */
WasmEdge_ConfigureCompilerSetOptimizationLevel(ConfCxt, WasmEdge_CompilerOptimizationLevel_O2);
/* By default, the output format is universal WASM. */
WasmEdge_ConfigureCompilerSetOutputFormat(ConfCxt, WasmEdge_CompilerOutputFormat_Native);
/* By default, the dump IR is `FALSE`. */
WasmEdge_ConfigureCompilerSetDumpIR(ConfCxt, TRUE);
/* By default, the generic binary is `FALSE`. */
WasmEdge_ConfigureCompilerSetGenericBinary(ConfCxt, TRUE);
WasmEdge_ConfigureDelete(ConfCxt); Statistics options The statistics options configure the behavior about instruction counting, cost measuring, and time measuring in both runtime and AOT compiler. These configurations are effective in Compiler, VM, and Executor contexts. WasmEdge_ConfigureContext *ConfCxt = WasmEdge_ConfigureCreate();
/* By default, the intruction counting is `FALSE` when running a compiled-WASM or a pure-WASM. */
WasmEdge_ConfigureStatisticsSetInstructionCounting(ConfCxt, TRUE);
/* By default, the cost measurement is `FALSE` when running a compiled-WASM or a pure-WASM. */
WasmEdge_ConfigureStatisticsSetCostMeasuring(ConfCxt, TRUE);
/* By default, the time measurement is `FALSE` when running a compiled-WASM or a pure-WASM. */
WasmEdge_ConfigureStatisticsSetTimeMeasuring(ConfCxt, TRUE);
WasmEdge_ConfigureDelete(ConfCxt);

