The statistics context, WasmEdge_StatisticsContext, provides the instruction counter, cost summation, and cost limitation at runtime. Before using statistics, the statistics configuration must be set. Otherwise, the return values of calling statistics are undefined behaviour. Instruction counter The instruction counter can help developers to profile the performance of WASM running. Developers can retrieve the Statistics context from the VM context, or create a new one for the Executor creation. The details will be introduced in the next partitions. WasmEdge_StatisticsContext *StatCxt = WasmEdge_StatisticsCreate();
/* .... * After running the WASM functions with the `Statistics` context */
uint32_t Count = WasmEdge_StatisticsGetInstrCount(StatCxt);
double IPS = WasmEdge_StatisticsGetInstrPerSecond(StatCxt);
WasmEdge_StatisticsDelete(StatCxt); Cost table The cost table is to accumulate the cost of instructions with their weights. Developers can set the cost table array (the indices are the byte code value of instructions, and the values are the cost of instructions) into the Statistics context. If the cost limit value is set, the execution will return the cost limit exceeded error immediately when exceeds the cost limit in runtime. WasmEdge_StatisticsContext *StatCxt = WasmEdge_StatisticsCreate();
uint64_t CostTable[16] = { 0, 0, 10, /* 0x02: Block */ 11, /* 0x03: Loop */ 12, /* 0x04: If */ 12, /* 0x05: Else */ 0, 0, 0, 0, 0, 0, 20, /* 0x0C: Br */ 21, /* 0x0D: Br_if */ 22, /* 0x0E: Br_table */ 0
};
/* Developers can set the costs of each instruction. The value not covered will be 0. */
WasmEdge_StatisticsSetCostTable(StatCxt, CostTable, 16);
WasmEdge_StatisticsSetCostLimit(StatCxt, 5000000);
/* .... * After running the WASM functions with the `Statistics` context */
uint64_t Cost = WasmEdge_StatisticsGetTotalCost(StatCxt);
WasmEdge_StatisticsDelete(StatCxt);

