In this example , we will demonstrate how to call a Rust-based WebAssembly function from a Go app. Specially, we will discuss how to pass string data. An alternative approach to pass and return complex values to Rust functions in WebAssembly is to use the wasm-bindgen compiler tool. You can learn more here . The Rust function takes a memory pointer for the string, and constructs the Rust string itself. use std::ffi::{CStr, CString};
use std::mem;
use std::os::raw::{c_char, c_void}; #[no_mangle]
pub extern fn allocate(size: usize) -> *mut c_void { let mut buffer = Vec::with_capacity(size); let pointer = buffer.as_mut_ptr(); mem::forget(buffer); pointer as *mut c_void
} #[no_mangle]
pub extern fn deallocate(pointer: *mut c_void, capacity: usize) { unsafe { let _ = Vec::from_raw_parts(pointer, 0, capacity); }
} #[no_mangle]
pub extern fn greet(subject: *mut c_char) -> *mut c_char { let subject = unsafe { CStr::from_ptr(subject).to_bytes().to_vec() }; let mut output = b"Hello, ".to_vec(); output.extend(&subject); output.extend(&[b'!']); unsafe { CString::from_vec_unchecked(output) }.into_raw()
} Use standard Rust compiler tools to compile the Rust source code into a WebAssembly bytecode application. $ cd rust_memory_greet
$ cargo build --target wasm32-wasi
# The output WASM will be `target/wasm32-wasi/debug/rust_memory_greet_lib.wasm`. The Go SDK application must call allocate from the WasmEdge VM to get a pointer to the string parameter. It will then call the greet function in Rust with the pointer. After the function returns, the Go application will call deallocate to free the memory space. package main import ( "fmt" "os" "strings" "github.com/second-state/WasmEdge-go/wasmedge"
) func main() { wasmedge.SetLogErrorLevel() conf := wasmedge.NewConfigure(wasmedge.WASI) store := wasmedge.NewStore() vm := wasmedge.NewVMWithConfigAndStore(conf, store) wasi := vm.GetImportObject(wasmedge.WASI) wasi.InitWasi( os.Args[1:], os.Environ(), []string{".:."}, ) err := vm.LoadWasmFile(os.Args[1]) if err != nil { fmt.Println("failed to load wasm") } vm.Validate() vm.Instantiate() subject := "WasmEdge" lengthOfSubject := len(subject) // Allocate memory for the subject, and get a pointer to it. // Include a byte for the NULL terminator we add below. allocateResult, _ := vm.Execute("allocate", int32(lengthOfSubject+1)) inputPointer := allocateResult[0].(int32) // Write the subject into the memory. mem := store.FindMemory("memory") memData, _ := mem.GetData(uint(inputPointer), uint(lengthOfSubject+1)) copy(memData, subject) // C-string terminates by NULL. memData[lengthOfSubject] = 0 // Run the `greet` function. Given the pointer to the subject. greetResult, _ := vm.Execute("greet", inputPointer) outputPointer := greetResult[0].(int32) pageSize := mem.GetPageSize() // Read the result of the `greet` function. memData, _ = mem.GetData(uint(0), uint(pageSize * 65536)) nth := 0 var output strings.Builder for { if memData[int(outputPointer) + nth] == 0 { break } output.WriteByte(memData[int(outputPointer) + nth]) nth++ } lengthOfOutput := nth fmt.Println(output.String()) // Deallocate the subject, and the output. vm.Execute("deallocate", inputPointer, int32(lengthOfSubject+1)) vm.Execute("deallocate", outputPointer, int32(lengthOfOutput+1)) vm.Release() store.Release() conf.Release()
} To build the Go SDK example, run the following commands. $ go get github.com/second-state/WasmEdge-go/wasmedge@v0.9.0-rc5
$ go build greet_memory.go Now you can use the Go application to run the WebAssembly plug-in compiled from Rust. $ ./greet_memory rust_memory_greet_lib.wasm
Hello, WasmEdge!

