In WasmEdge-go, the APIs will automatically do the conversion for the built-in types, and implement the data structure for the reference types. Number types: i32, i64, f32, and f64 Convert the uint32 and int32 to i32 automatically when passing a value into WASM. Convert the uint64 and int64 to i64 automatically when passing a value into WASM. Convert the uint and int to i32 automatically when passing a value into WASM in 32-bit system. Convert the uint and int to i64 automatically when passing a value into WASM in 64-bit system. Convert the float32 to f32 automatically when passing a value into WASM. Convert the float64 to f64 automatically when passing a value into WASM. Convert the i32 from WASM to int32 when getting a result. Convert the i64 from WASM to int64 when getting a result. Convert the f32 from WASM to float32 when getting a result. Convert the f64 from WASM to float64 when getting a result. Number type: v128 for the SIMD proposal Developers should use the wasmedge.NewV128() to generate a v128 value, and use the wasmedge.GetV128() to get the value. val := wasmedge.NewV128(uint64(1234), uint64(5678))
