// `rtype` will be `wasmedge.RefType_ExternRef`.
getlim := tabtype.GetLimit()
// `getlim` will be the same value as `lim`. tabtype.Release() Memory type context The MemoryType is an object holds the memory type context and used for Memory instance creation or getting information from Memory instances. lim := wasmedge.NewLimit(1)
memtype := wasmedge.NewMemoryType(lim) getlim := memtype.GetLimit()
// `getlim` will be the same value as `lim`. memtype.Release() Global type context The GlobalType is an object holds the global type context and used for Global instance creation or getting information from Global instances. globtype := wasmedge.NewGlobalType(wasmedge.ValType_F64, wasmedge.ValMut_Var) vtype := globtype.GetValType()
