Host functions are functions outside WebAssembly and passed to WASM modules as imports. In WasmEdge-go, developers can create the Function, Memory, Table, and Global objects and add them into an ImportObject object for registering into a VM or a Store. Host function allocation Developers can define Go functions with the following function signature as the host function body: type hostFunctionSignature func( data interface{}, mem *Memory, params []interface{}) ([]interface{}, Result) The example of an add host function to add 2 i32 values: func host_add(data interface{}, mem *wasmedge.Memory, params []interface{}) ([]interface{}, wasmedge.Result) { // add: i32, i32 -> i32 res := params[0].(int32) + params[1].(int32) /// Set the returns returns := make([]interface{}, 1) returns[0] = res /// Return return returns, wasmedge.Result_Success
} Then developers can create Function object with the host function body and function type: // Create a function type: {i32, i32} -> {i32}.
functype := wasmedge.NewFunctionType( []wasmedge.ValType{wasmedge.ValType_I32, wasmedge.ValType_I32}, []wasmedge.ValType{wasmedge.ValType_I32},
) // Create a function context with the function type and host function body.
// The third parameter is the pointer to the additional data.
// Developers should guarantee the life cycle of the data, and it can be
// `nil` if the external data is not needed.
// The last parameter can be 0 if developers do not need the cost measuring.
func_add := wasmedge.NewFunction(functype, host_add, nil, 0) // If the function object is not added into an import object object, it should be released.
func_add.Release()
functype.Release() Import object object The ImportObject object holds an exporting module name and the instances. Developers can add the Function, Memory, Table, and Global instances with their exporting names. // Host function body definition.
func host_add(data interface{}, mem *wasmedge.Memory, params []interface{}) ([]interface{}, wasmedge.Result) { // add: i32, i32 -> i32 res := params[0].(int32) + params[1].(int32) /// Set the returns returns := make([]interface{}, 1) returns[0] = res /// Return return returns, wasmedge.Result_Success
} // Create the import object with the module name "module".
impobj := wasmedge.NewImportObject("module") // Create and add a function instance into the import object with export name "add".
functype := wasmedge.NewFunctionType( []wasmedge.ValType{wasmedge.ValType_I32, wasmedge.ValType_I32}, []wasmedge.ValType{wasmedge.ValType_I32},
)
hostfunc := wasmedge.NewFunction(functype, host_add, nil, 0)
functype.Release()
impobj.AddFunction("add", hostfunc) // Create and add a table instance into the import object with export name "table".
tabtype := wasmedge.NewTableType(wasmedge.RefType_FuncRef ,wasmedge.NewLimitWithMax(10, 20))
hosttab := wasmedge.NewTable(tabtype)
