The next example shows a web application that computes the roots for quadratic equations. Please checkout the full source code here . The user enters the values for a, b, c on the web form, and the web application calls the web service at /solve to compute the roots for the quadratic equation. a*X^2 + b*X + c = 0 The roots for X are displayed in the area below the input form. The HTML file contains the client side JavaScript to submit the web form to /solve, and put result into the #roots HTML element on the page. $(function() { var options = { target: '#roots', url: "/solve", type: "post" }; $('#solve').ajaxForm(options);
}); The Node.js application behind the /solve URL endpoint is as follows. It reads the data from the input form, passes them into the solve function as an array, and puts the return value in the HTTP response. app.post('/solve', function (req, res) { var a = parseFloat(req.body.a); var b = parseFloat(req.body.b); var c = parseFloat(req.body.c); res.send(solve([a, b, c]))
}) The solve function is written in Rust and runs inside the WasmEdge Runtime. While the call arguments in the JavaScript side is an array of values, the Rust function receives a JSON object that encapsulates the array. In the Rust code, we first decode the JSON, perform the computation, and return the result values in a JSON string. #[wasm_bindgen]
pub fn solve(params: &str) -> String { let ps: (f32, f32, f32) = serde_json::from_str(&params).unwrap(); let discriminant: f32 = (ps.1 * ps.1) - (4. * ps.0 * ps.2); let mut solution: (f32, f32) = (0., 0.); if discriminant >= 0. { solution.0 = (((-1.) * ps.1) + discriminant.sqrt()) / (2. * ps.0); solution.1 = (((-1.) * ps.1) - discriminant.sqrt()) / (2. * ps.0); return serde_json::to_string(&solution).unwrap(); } else { return String::from("not real numbers"); }
} Let's try it. $ rustwasmc build
$ npm install express # The application requires the Express framework in Node.js $ node node/server.js From the web browser, go to http://ip-addr:8080/ to access this application. Note: If you are using Docker, make sure that the Docker container port 8080 is mapped to the host port 8080. That’s it for the quadratic equation example.

