Besides passing string values between Rust and JavaScript, the rustwasmc tool supports the following data types. Rust call parameters can be any combo of i32, String, &str, Vec<u8>, and &[u8] Return value can be i32 or String or Vec<u8> or void For complex data types, such as structs, you could use JSON strings to pass data. With JSON support, you can call Rust functions with any number of input parameters and return any number of return values of any type. The Rust program src/lib.rs in the functions example demonstrates how to pass in call arguments in various supported types, and return values. #[wasm_bindgen]
pub fn obfusticate(s: String) -> String { (&s).chars().map(|c| { match c { 'A' ..= 'M' | 'a' ..= 'm' => ((c as u8) + 13) as char, 'N' ..= 'Z' | 'n' ..= 'z' => ((c as u8) - 13) as char, _ => c } }).collect()
} #[wasm_bindgen]
pub fn lowest_common_denominator(a: i32, b: i32) -> i32 { let r = lcm(a, b); return r;
} #[wasm_bindgen]
pub fn sha3_digest(v: Vec<u8>) -> Vec<u8> { return Sha3_256::digest(&v).as_slice().to_vec();
} #[wasm_bindgen]
pub fn keccak_digest(s: &[u8]) -> Vec<u8> { return Keccak256::digest(s).as_slice().to_vec();
} Perhaps the most interesting is the create_line() function. It takes two JSON strings, each representing a Point struct, and returns a JSON string representing a Line struct. Notice that both the Point and Line structs are annotated with Serialize and Deserialize so that the Rust compiler automatically generates necessary code to support their conversion to and from JSON strings. use wasm_bindgen::prelude::*;
use serde::{Serialize, Deserialize}; #[derive(Serialize, Deserialize, Debug)]
struct Point { x: f32, y: f32
} #[derive(Serialize, Deserialize, Debug)]
struct Line { points: Vec<Point>, valid: bool, length: f32, desc: String
} #[wasm_bindgen]
pub fn create_line (p1: &str, p2: &str, desc: &str) -> String { let point1: Point = serde_json::from_str(p1).unwrap(); let point2: Point = serde_json::from_str(p2).unwrap(); let length = ((point1.x - point2.x) * (point1.x - point2.x) + (point1.y - point2.y) * (point1.y - point2.y)).sqrt(); let valid = if length == 0.0 { false } else { true }; let line = Line { points: vec![point1, point2], valid: valid, length: length, desc: desc.to_string() }; return serde_json::to_string(&line).unwrap();
} #[wasm_bindgen]
pub fn say(s: &str) -> String { let r = String::from("hello "); return r + s;
} Next, let's examine the JavaScript program app.js . It shows how to call the Rust functions. As you can see String and &str are simply strings in JavaScript, i32 are numbers, and Vec<u8> or &[8] are JavaScript Uint8Array. JavaScript objects need to go through JSON.stringify() or JSON.parse() before being passed into or returned from Rust functions. const { say, obfusticate, lowest_common_denominator, sha3_digest, keccak_digest, create_line } = require('./functions_lib.js'); var util = require('util');
const encoder = new util.TextEncoder();
console.hex = (d) => console.log((Object(d).buffer instanceof ArrayBuffer ? new Uint8Array(d.buffer) : typeof d === 'string' ? (new util.TextEncoder('utf-8')).encode(d) : new Uint8ClampedArray(d)).reduce((p, c, i, a) => p + (i % 16 === 0 ? i.toString(16).padStart(6, 0) + ' ' : ' ') + c.toString(16).padStart(2, 0) + (i === a.length - 1 || i % 16 === 15 ? ' '.repeat((15 - i % 16) * 3) + Array.from(a).splice(i - i % 16, 16).reduce((r, v) => r + (v > 31 && v < 127 || v > 159 ? String.fromCharCode(v) : '.'), ' ') + '\n' : ''), '')); console.log( say("WasmEdge") );
