The image-api-rs sidecar application is written in Rust. It should already have the WebAssembly function lib/grayscale.wasm installed from the previous step. Please refer to the functions/bin/install.sh script to install the WasmEdge Runtime binary lib/wasmedge-tensorflow-lite and its dependencies. The sidecar microservice runs a Tokio-based event loop that listens for incoming HTTP requests at the path /api/image. #[tokio::main]
pub async fn run_server(port: u16) { pretty_env_logger::init(); let home = warp::get().map(warp::reply); let image = warp::post() .and(warp::path("api")) .and(warp::path("image")) .and(warp::body::bytes()) .map(|bytes: bytes::Bytes| { let v: Vec<u8> = bytes.iter().map(|&x| x).collect(); let res = image_process(&v); Ok(Box::new(res)) }); let routes = home.or(image); let routes = routes.with(warp::cors().allow_any_origin()); let log = warp::log("dapr_wasm"); let routes = routes.with(log); warp::serve(routes).run((Ipv4Addr::UNSPECIFIED, port)).await
} Once it receives an image file in the HTTP POST request, it invokes a WebAssembly function in WasmEdge to perform the image processing task. It creates a WasmEdge instance to interact with the WebAssembly program. pub fn image_process(buf: &Vec<u8>) -> Vec<u8> { let mut child = Command::new("./lib/wasmedge-tensorflow-lite") .arg("./lib/grayscale.wasm") .stdin(Stdio::piped()) .stdout(Stdio::piped()) .spawn() .expect("failed to execute child"); { // limited borrow of stdin let stdin = child.stdin.as_mut().expect("failed to get stdin"); stdin.write_all(buf).expect("failed to write to stdin"); } let output = child.wait_with_output().expect("failed to wait on child"); output.stdout
} The following Dapr CLI command starts the microservice in the Dapr runtime environment. $ cd image-api-rs
$ sudo dapr run --app-id image-api-rs \ --app-protocol http \ --app-port 9004 \ --dapr-http-port 3502 \ --components-path ../config \ --log-level debug \ ./target/debug/image-api-rs
$ cd ../

