A simple host function class can be declared as follows: #include "common/errcode.h"
#include "runtime/hostfunc.h"
#include "runtime/instance/memory.h" namespace WasmEdge {
namespace Host { class TestHost : public Runtime::HostFunction<TestHost> {
public: Expect<uint32_t> body(Runtime::Instance::MemoryInstance *MemInst, uint32_t Param1, float Param2);
}; } // namespace Host
} // namespace WasmEdge According to example, return type Expect<T> presents the expected return number type T of this host function. Types of Param1 and Param2 presents argument types of this host function. Only WASM built-in types (aka. uint32_t, uint64_t, float, and double) are supported in host functions. When instantiating, the function signature of vec(valtype) -> resulttype is generated and can be imported by WASM modules. Note: In the current state, only a single value returning is supported. Another situation is passing environments or information which need to be accessed by host function body. The following sample shows how to implement host function clusters: #include "common/errcode.h"
