Host module provides addHostFunc(), addHostTable(), addHostMemory(), and addHostGlobal() to insert instances with their unique names. Insertion can be done in constructor. The following example also shows how to create host memories, tables, and globals. #include "common/errcode.h"
#include "runtime/hostfunc.h"
#include "runtime/importobj.h"
#include <memory>
#include <vector> namespace WasmEdge {
namespace Host { template <typename T> class TestCluster : public Runtime::HostFunction<T> {
public: TestCluster(std::vector<uint8_t> &Vec) : Data(Vec) {} protected: std::vector<uint8_t> &Data;
}; class TestHost1 : public TestCluster<TestHost1> {
public: TestHost1(std::vector<uint8_t> &Vec) : TestCluster(Vec) {} Expect<uint32_t> body(Runtime::Instance::MemoryInstance *MemInst, uint32_t Param1, float Param2) { /// Operations to `Data` ... return {}; }
}; class TestHost2 : public TestCluster<TestHost2> {
public: TestHost2(std::vector<uint8_t> &Vec) : TestCluster(Vec) {} Expect<uint64_t> body(Runtime::Instance::MemoryInstance *MemInst, uint64_t Param1, double Param2) { /// Operations to `Data` ... return {}; }
}; class TestModule : public Runtime::ImportObject {
public: TestModule(std::vector<uint8_t> &Vec) : ImportObject("test"), Data(Vec) { /// Add function instances with exporting name addHostFunc("test_func1", std::make_unique<TestHost1>(Data)); addHostFunc("test_func2", std::make_unique<TestHost2>(Data)); /// Add table instance with exporting name addHostTable("table", std::make_unique<Runtime::Instance::TableInstance>( TableType(RefType::FuncRef, 10, 20))); /// Add memory instance with exporting name addHostMemory("memory", std::make_unique<Runtime::Instance::MemoryInstance>( MemoryType(1, 2))); /// Add global instance with exporting name addHostGlobal("global_i32", std::make_unique<Runtime::Instance::GlobalInstance>( GlobalType(ValType::I32, ValMut::Const), uint32_t(666))); addHostGlobal("global_i64", std::make_unique<Runtime::Instance::GlobalInstance>( GlobalType(ValType::I64, ValMut::Const), uint64_t(666))); addHostGlobal("global_f32", std::make_unique<Runtime::Instance::GlobalInstance>( GlobalType(ValType::F32, ValMut::Const), float(666))); addHostGlobal("global_f64", std::make_unique<Runtime::Instance::GlobalInstance>( GlobalType(ValType::F64, ValMut::Const), double(666))); } virtual ~TestModule() = default; private: std::vector<uint8_t> &Data;
}; } // namespace Host
} // namespace WasmEdge Host module supplies getFuncs(), getTables(), getMems(), and getGlobals() to search registered instances by unique exporting name. For more details, APIs can be found in include/runtime/importobj.h.

