The host module should be implemented and registered into WasmEdge before executing Wasm. Assume that the following code is saved as main.c: #include <wasmedge/wasmedge.h> #include <stdio.h> uint32_t SquareFunc(uint32_t A) { return A * A; }
uint32_t AddFunc(uint32_t A, uint32_t B) { return A + B; }
uint32_t MulFunc(uint32_t A, uint32_t B) { return A * B; } /// Host function to call `SquareFunc` by external reference
WasmEdge_Result ExternSquare(void *Data, WasmEdge_MemoryInstanceContext *MemCxt, const WasmEdge_Value *In, WasmEdge_Value *Out) { /// Function type: {externref, i32} -> {i32} uint32_t (*Func)(uint32_t) = WasmEdge_ValueGetExternRef(In[0]); uint32_t C = Func(WasmEdge_ValueGetI32(In[1])); Out[0] = WasmEdge_ValueGenI32(C); return WasmEdge_Result_Success;
} /// Host function to call `AddFunc` by external reference
WasmEdge_Result ExternAdd(void *Data, WasmEdge_MemoryInstanceContext *MemCxt, const WasmEdge_Value *In, WasmEdge_Value *Out) { /// Function type: {externref, i32, i32} -> {i32} uint32_t (*Func)(uint32_t, uint32_t) = WasmEdge_ValueGetExternRef(In[0]); uint32_t C = Func(WasmEdge_ValueGetI32(In[1]), WasmEdge_ValueGetI32(In[2])); Out[0] = WasmEdge_ValueGenI32(C); return WasmEdge_Result_Success;
} /// Host function to call `ExternMul` by external reference
WasmEdge_Result ExternMul(void *Data, WasmEdge_MemoryInstanceContext *MemCxt, const WasmEdge_Value *In, WasmEdge_Value *Out) { /// Function type: {externref, i32, i32} -> {i32} uint32_t (*Func)(uint32_t, uint32_t) = WasmEdge_ValueGetExternRef(In[0]); uint32_t C = Func(WasmEdge_ValueGetI32(In[1]), WasmEdge_ValueGetI32(In[2])); Out[0] = WasmEdge_ValueGenI32(C); return WasmEdge_Result_Success;
} /// Helper function to create the "extern_module" import object.
WasmEdge_ImportObjectContext *CreateExternModule() { WasmEdge_String HostName; WasmEdge_FunctionTypeContext *HostFType = NULL; WasmEdge_FunctionInstanceContext *HostFunc = NULL; enum WasmEdge_ValType P[3], R[1]; HostName = WasmEdge_StringCreateByCString("extern_module"); WasmEdge_ImportObjectContext *ImpObj = WasmEdge_ImportObjectCreate(HostName); WasmEdge_StringDelete(HostName); /// Add host function "functor_square": {externref, i32} -> {i32} P[0] = WasmEdge_ValType_ExternRef; P[1] = WasmEdge_ValType_I32; R[0] = WasmEdge_ValType_I32; HostFType = WasmEdge_FunctionTypeCreate(P, 2, R, 1); HostFunc = WasmEdge_FunctionInstanceCreate(HostFType, ExternSquare, NULL, 0); WasmEdge_FunctionTypeDelete(HostFType); HostName = WasmEdge_StringCreateByCString("functor_square"); WasmEdge_ImportObjectAddFunction(ImpObj, HostName, HostFunc); WasmEdge_StringDelete(HostName); /// Add host function "class_add": {externref, i32, i32} -> {i32} P[2] = WasmEdge_ValType_I32; HostFType = WasmEdge_FunctionTypeCreate(P, 3, R, 1); HostFunc = WasmEdge_FunctionInstanceCreate(HostFType, ExternAdd, NULL, 0); WasmEdge_FunctionTypeDelete(HostFType); HostName = WasmEdge_StringCreateByCString("class_add"); WasmEdge_ImportObjectAddFunction(ImpObj, HostName, HostFunc); WasmEdge_StringDelete(HostName); /// Add host function "func_mul": {externref, i32, i32} -> {i32} HostFType = WasmEdge_FunctionTypeCreate(P, 3, R, 1); HostFunc = WasmEdge_FunctionInstanceCreate(HostFType, ExternMul, NULL, 0); WasmEdge_FunctionTypeDelete(HostFType); HostName = WasmEdge_StringCreateByCString("func_mul"); WasmEdge_ImportObjectAddFunction(ImpObj, HostName, HostFunc); WasmEdge_StringDelete(HostName); return ImpObj;
} int main() { WasmEdge_VMContext *VMCxt = WasmEdge_VMCreate(NULL, NULL); WasmEdge_ImportObjectContext *ImpObj = CreateExternModule(); WasmEdge_Value P[3], R[1]; WasmEdge_String FuncName; WasmEdge_Result Res; Res = WasmEdge_VMRegisterModuleFromImport(VMCxt, ImpObj); if (!WasmEdge_ResultOK(Res)) { printf("Import object registration failed\n"); return EXIT_FAILURE; } Res = WasmEdge_VMLoadWasmFromFile(VMCxt, "funcs.wasm"); if (!WasmEdge_ResultOK(Res)) { printf("WASM file loading failed\n"); return EXIT_FAILURE; } Res = WasmEdge_VMValidate(VMCxt); if (!WasmEdge_ResultOK(Res)) { printf("WASM validation failed\n"); return EXIT_FAILURE; } Res = WasmEdge_VMInstantiate(VMCxt); if (!WasmEdge_ResultOK(Res)) { printf("WASM instantiation failed\n"); return EXIT_FAILURE; } /// Test 1: call add -- 1234 + 5678 P[0] = WasmEdge_ValueGenExternRef(AddFunc); P[1] = WasmEdge_ValueGenI32(1234); P[2] = WasmEdge_ValueGenI32(5678); FuncName = WasmEdge_StringCreateByCString("call_add"); Res = WasmEdge_VMExecute(VMCxt, FuncName, P, 3, R, 1); WasmEdge_StringDelete(FuncName); if (WasmEdge_ResultOK(Res)) { printf("Test 1 -- `call_add` -- 1234 + 5678 = %d\n", WasmEdge_ValueGetI32(R[0])); } else { printf("Test 1 -- `call_add` -- 1234 + 5678 -- failed\n"); return EXIT_FAILURE; } /// Test 2: call mul -- 789 * 4321 P[0] = WasmEdge_ValueGenExternRef(MulFunc); P[1] = WasmEdge_ValueGenI32(789); P[2] = WasmEdge_ValueGenI32(4321); FuncName = WasmEdge_StringCreateByCString("call_mul"); Res = WasmEdge_VMExecute(VMCxt, FuncName, P, 3, R, 1); WasmEdge_StringDelete(FuncName); if (WasmEdge_ResultOK(Res)) { printf("Test 2 -- `call_mul` -- 789 * 4321 = %d\n", WasmEdge_ValueGetI32(R[0])); } else { printf("Test 2 -- `call_mul` -- 789 * 4321 -- failed\n"); return EXIT_FAILURE; } /// Test 3: call square -- 8256^2 P[0] = WasmEdge_ValueGenExternRef(SquareFunc); P[1] = WasmEdge_ValueGenI32(8256); FuncName = WasmEdge_StringCreateByCString("call_square"); Res = WasmEdge_VMExecute(VMCxt, FuncName, P, 2, R, 1); if (WasmEdge_