The WebAssembly VM is a pure software construct. It does not have a hardware entropy source for random numbers. That's why WASI defines a function for WebAssembly programs to call its host operating system to get a random seed. As a Rust developer, all you need is to use the popular (de facto standard) rand and/or getrandom crates. With the wasm32-wasi compiler backend, these crates generate the correct WASI calls in the WebAssembly bytecode. The Cargo.toml dependencies are as follows. [dependencies]
rand = "0.7.3"
getrandom = "0.1.14" The Rust code to get random number from WebAssembly is this. use rand::prelude::*; pub fn get_random_i32() -> i32 { let x: i32 = random(); return x;
} pub fn get_random_bytes() -> Vec<u8> { let mut rng = thread_rng(); let mut arr = [0u8; 128]; rng.fill(&mut arr[..]); return arr.to_vec();
}

