The source code for the HTTP server application is available as follows. use bytecodec::DecodeExt;
use httpcodec::{HttpVersion, ReasonPhrase, Request, RequestDecoder, Response, StatusCode};
use std::io::{Read, Write};
#[cfg(feature = "std")]
use std::net::{Shutdown, TcpListener, TcpStream};
#[cfg(not(feature = "std"))]
use wasmedge_wasi_socket::{Shutdown, TcpListener, TcpStream}; fn handle_http(req: Request<String>) -> bytecodec::Result<Response<String>> { Ok(Response::new( HttpVersion::V1_0, StatusCode::new(200)?, ReasonPhrase::new("")?, format!("echo: {}", req.body()), ))
} fn handle_client(mut stream: TcpStream) -> std::io::Result<()> { let mut buff = [0u8; 1024]; let mut data = Vec::new(); loop { let n = stream.read(&mut buff)?; data.extend_from_slice(&buff[0..n]); if n < 1024 { break; } } let mut decoder = RequestDecoder::<httpcodec::BodyDecoder<bytecodec::bytes::Utf8Decoder>>::default(); let req = match decoder.decode_from_bytes(data.as_slice()) { Ok(req) => handle_http(req), Err(e) => Err(e), }; let r = match req { Ok(r) => r, Err(e) => { let err = format!("{:?}", e); Response::new( HttpVersion::V1_0, StatusCode::new(500).unwrap(), ReasonPhrase::new(err.as_str()).unwrap(), err.clone(), ) } }; let write_buf = r.to_string(); stream.write(write_buf.as_bytes())?; stream.shutdown(Shutdown::Both)?; Ok(())
} fn main() -> std::io::Result<()> { let port = std::env::var("PORT").unwrap_or(1234.to_string()); println!("new connection at {}", port); let listener = TcpListener::bind(format!("0.0.0.0:{}", port))?; loop { let _ = handle_client(listener.accept()?.0); }
} To compile this source code, you must have the following in your Cargo.toml. [dependencies]
wasmedge_http_req = "0.8.1" The following command compiles the Rust program. cargo build --target wasm32-wasi --release The following command runs the application in WasmEdge. wasmedge target/wasm32-wasi/release/http_server.wasm
new connection at 1234 To test the HTTP server, you can submit a HTTP request to it via curl. curl -d "name=WasmEdge" -X POST http://127.0.0.1:1234
